import logo from './logo.svg';
import './App.css';

function App() {
  const names = () =>{
    const name = ['ijaas','jaga','dharai'];
  const ran = Math.floor(Math.random() *3);
  return name[ran];
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Hello Guys{names()}</p>
      </header>
    </div>
  );
}

export default App;
